column8:
あの「スペース暖シートぽかぽか」があたらしくPREMIUMにバージョンアップ!!1cm2に直径120ミクロンのホールが約50個も開いています。これにより通気性がアップし、快適さもアップ。軽くて暖かいだけではなく、電源不要で消し忘れによる、過熱の心配もなし。また、経済的。コンパクトにたためるので、登山やピクニックのときのリュックに入れたり、車の中に仮眠用として常備しておくのにもピッタリ。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">あの「スペース暖シートぽかぽか」があたらしくPREMIUMにバージョンアップ!!1cm2に直径120ミクロンのホールが約50個も開いています。これにより通気性がアップし、快適さもアップ。軽くて暖かいだけではなく、電源不要で消し忘れによる、過熱の心配もなし。また、経済的。コンパクトにたためるので、登山やピクニックのときのリュックに入れたり、車の中に仮眠用として常備しておくのにもピッタリ。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">107×170cm(1枚あたり)</font><br><font color="#333333" size="-1">個装サイズ：24×19×6cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">125g(1枚あたり)</font><br><font color="#333333" size="-1">個装重量：300g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">アルミ、透明ポリエチレンフィルム、不織布</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">アメリカ</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
